import React from "react";

import "./BottomMenu.css";

const BottomMenu = () => {
  return (
    <section className="bottomContainer">
      <ul className="paging">
        <li>1</li>
        <li>2</li>
        <li>3</li>
        <li>4</li>
        <li>5</li>
      </ul>
      <article className="searching">검색</article>
    </section>
  );
};

export default BottomMenu;
